message:
Кизару рассказал, что четыре месяца провёл в тюрьме.

Рэпер написал в Инстаграме, что в ноябре был арестован Интерполом в Германии и провел новогодние праздники за решеткой. Артист давно находится на ПМЖ в Барселоне — именно там совместно с Big Baby Tape был записан один из самых популярных альбомов прошлого года Bandana I. Из России музыкант уехал из-за обвинений в распространении наркотиков.

@superru

Организаторы «Формулы-1» проведут сегодня экстренное совещание, чтобы решить судьбу российского гонщика Никиты Мазепина.  

Издание Daily Mail сообщает, что cпортсмена хотят отстранить от соревнований из-за конфликта на Украине, поскольку отец Никиты, миллиардер Дмитрий Мазепин, тесно связан с российской властью.

@superru

Валерия Гергиева отстранили от должности главного дирижера и художественного руководителя Мюнхенского филармонического оркестра.

Также ему ищут замену в миланском театре La Scala. 

@superru

The Killers отменили выступление на фестивале Park Live, который должен пройти в июне и июле на московской площадке «Лужники-парк».  

В лайн-апе мероприятия, растянувшегося на 10 летних дней, заявлены культовые рок-группы и исполнители, среди которых Sum 41, Gorillaz, Deftones, Iggy Pop, Placebo, Slipknot, Limp Bizkit и My Chemical Romance. Судя по всему, сейчас они один за другим начнут объявлять, что не приедут в Россию. 

@superru

У кого точно все более-менее стабильно сейчас, так это у Бритни Спирс. 

Певица вновь дропнула в свой Инстаграм серию голых фото, на этот раз на пляже, прикрыв причинные места смайликами в виде алмазов. 

@superru

Джиджи Хадид в новом образе — олицетворение этого понедельника.

Сейчас 26-летняя модель находится в Париже на Неделе моды, где ее заметили на балконе во время съемки для бренда Off-White. Хадид трудно узнать из-за осветленных бровей и опухшего лица. Ходят слухи, что на ее внешности сказывается болезнь Хашимото — хроническое заболевание щитовидной железы.

@superru

OnlyFans запретил девушкам из России и Белоруссии регистрироваться и выводить заработанные деньги.

Желающие поторговать пикантными фотокарточками столкнулись с тем, что теперь сервис не принимает новые подписки и блокирует уже созданные аккаунты россиян и белорусов. Ню-модели в срочном порядке начали искать альтернативные платформы — для многих это был единственный способ заработка. После жалоб от тысяч пользовательниц OnlyFans восстановил учетные записи и пообещал, что они смогут получить свою зарплату.

@superru

Сегодня ночью в Сеть слили телефоны Николая Баскова, Тины Канделаки и Олега Газманова. Все эти артисты выступили в соцсетях в поддержку России.

Утром номера звёзд опубликовала продюсер шоу «Орел и решка» Мария Гранкина и призвала своих подписчиков «попробовать их переубедить». 

@superru

Теннисист Даниил Медведев официально стал первой ракеткой мира. 

На вершину рейтинга ATP российский спортсмен попал впервые за 20 лет — в последний раз это удалось Марату Сафину. Медведев оказался на первом месте после того, как сербский теннисист Новак Джокович в четвертьфинале на турнире в Дубае проиграл чеху Иржи Веселому. 

@superru

Павел Дуров может ограничить работу Telegram в России и на Украине из-за фейков. Создатель мессенджера сделал заявление, что отслеживать недостоверную информацию попросту невозможно. Если ситуация усугубится, то на время конфликта работа телеграм-каналов будет ограниченна.

«Мы не хотим, чтобы Telegram использовался как инструмент, усугубляющий конфликты и разжигающий межнациональную рознь», — говорится в заявлении.

@superru

Канал «Жара» решил не транслировать и не приглашать прессу на свою премию, которая должна состояться завтра. В «Крокусе» пройдет концерт для зрителей, которые купили билеты. Красной дорожки не будет. 

Там должны выступить Ольга Бузова, Валя Карнавал, Егор Крид, Клава Кока, Джиган и множество поющих тиктокеров. Но на сегодняшний день точного списка артистов все еще нет. 

@superru

Джейсон Момоа и Лиза Боне снова сошлись.

В январе они объявили о расставании после 16 лет совместной жизни. Однако Аквамен получил второй шанс: издание Hollywood Life, ссылаясь на близких пары, сообщает, что актер снова съехался с бывшей женой. Звёзды уже две недели живут вместе и работают над отношениями. 

@superru

Бывший продюсер «Холостяка» Армен Оганян, которого уволили с ТНТ за «распространение радикальных политических взглядов», слил второго участника шоу. Его имя канал держал в секрете, но не слишком хорошо, поскольку информация давно была слита в Сеть.

Как и предполагалось, вторым холостяком стал Димаш Адилет — блогер и бизнесмен из Казахстана. 

@superru

Отключение страны от системы SWIFT — одна из самых обсуждаемых и противоречивых из возможных санкций против России. США считают этот шаг фатальным для нашей страны, экономисты пугают последствиями для рынка. Однако лидеры ЕС неспроста до последнего откладывают это решение. 

Разберемся, что такое SWIFT и как его отключение на самом деле на нас отразится, в материале на нашем сайте.

@superru

Шоу «Орел и решка» перестанут показывать на телеканале «Пятница». 

Канал разорвал договор с украинским продакшеном TeenSpirit, который выпускал шоу.

@superru

Владимир Жириновский находится в коме и подключен к ИВЛ.

Как сообщает Mash, состояние 75-летнего политика ухудшилось, врачи ввели его в медикаментозный сон. Последние недели лидер ЛДПР боролся с коронавирусом, стало известно, что он с трудом разговаривал и практически не мог самостоятельно дышать из-за поражения легких.

@superru

Первый канал, ВГТРК и радиодом «Останкино» приостановили свое членство в EBU (Европейский вещательный союз) после отстранения России от участия в Евровидении. 

Если вещатели не вернутся в союз, то представители России не смогут участвовать в конкурсе в будущем, не только в этом году. 

@superru

«Если бы все прошли мои марафоны, то не было бы никакой войны!» — так считает Елена Блиновская. 

На фоне событий на Украине блогерша решила провести марафон желаний, но не бесплатно (потому что бесплатно не работает). Она собирается подправить свои лекции с учетом происходящего и просит донаты за курсы по исполнению мечт. Для тех, кто не знает, что делать, лучшее решение, по мнению Блиновской, — пройти ее марафон.

@superru

Пользователи Twitter замечают, что на территории России приложение не работает. При попытке обновить ленту с телефона появляется сообщение «Сейчас не удается загрузить твиты». Сайт twitter.com доступен только при использовании VPN. 

Компания пока никак не комментирует ситуацию. 

@superru

«Когда же ты продала душу дьяволу?» Выяснения отношений по поводу Украины начались среди знаменитостей. Тина Канделаки опубликовала пост, в котором высказалась по поводу фейк-ньюс в телеграм-каналах, а также поддержала жителей Донбасса. Ей ответила экс-продюсер Светланы Лободы Нателла Крапивина, обвинив Канделаки в продажности. 

Ссору подытожила Ксения Собчак, встав на сторону Крапивиной. Собчак сначала задала вопрос в воздух о том, когда Тина продала душу дьяволу, а потом написала, что позиция Канделаки связана с тем, что недавно ее назначили гендиректором ТНТ. 

@superru

Россия не примет участие в Евровидении этого года. Об этом сообщили организаторы конкурса.

Ранее несколько стран, включая Украину, попросили Европейский вещательный союз отстранить Россию.

@superru

Зрители Первого канала заметили, что «Вечерний Ургант» пропал из сетки вещания, его заменило политическое шоу. В Сети это сразу же связали со вчерашними постами в соцсетях Ивана Урганта и Александра Гудкова. Ведущий ограничился черным квадратом, а вот его протеже Гудков публиковал гораздо более эмоциональные посты. 

В пресс-службе Первого канала эти подозрения отмели. По словам Ларисы Крымовой, главы пресс-службы Первого, переверстка связана с общественно-политическими событиями, а Иван Ургант продолжает работу на канале.

@superru

Вчера Евросоюз и США ввели санкции против России, под которые попали крупные банки. На волне тревожных новостей возле банкоматов выстраивались очереди, а всего за вчерашний день россияне сняли 111 миллиардов наличных. У всех остались вопросы: будут ли карты работать через Apple или Google Pay, можно ли ими пользоваться за границей и как санкции отразятся на обычных пользователях.

Сбер, который тоже попал под санкции, составил карточки, в которых ответил на главные вопросы.

@superru

УЕФА переносит все игры клубов и сборных на турнирах под своей эгидой с территории России и Украины. 

Это касается и финала Лиги чемпионов 2022: его перенесли из Санкт-Петербурга в Париж.

@superru

Анджелина Джоли обещает помочь беженцам, которые покидают Украину. Актриса опубликовала заявление, где сообщила, что сейчас работает вместе с организацией Refugee Agency, которая защищает тех, кто оставил свой дом. По последним данным, за минувшие сутки почти 30 тысяч человек въехали с Украины на территорию Польши.

«Я сосредоточена на том, чтобы сделать все возможное для обеспечения защиты и основных прав человека перемещенных лиц и беженцев в регионе. Мы уже видели сообщения о жертвах и людях, которые начали покидать свои дома в поисках безопасности. Еще слишком рано знать, что произойдет, но значение этого момента для народа Украины и для международного правопорядка невозможно переоценить».

@superru

The Weeknd вчера выбрал не самое удачное время для анонса. Во время объявления о начале военной операции на Украине певец написал в Твиттере «ПОГНАЛИ!‎»‎, намекая на скорый релиз. В ленте его подписчиков этот твит расположился между громкими политическими заявлениями и тревожными новостями, из-за чего многие решили, что артист поддержал военные действия.

Звезде срочно пришлось извиняться, он признался, что узнал о конфликте слишком поздно, и решил повременить с выпуском материала.

@superru

Елена Блиновская тем временем проводит у себя в Инстаграме краткий курс, как загадать желание, чтобы прекратить военные действия. Оказывается, чтобы отношения двух стран стабилизировались, нужно загадывать это от себя, «из точки своей сборки». А что это значит, она может объяснить на своем марафоне, о чем тонко намекает в тексте. 

Также блогерша репостнула сторис своей подписчицы, которая решила по этому поводу оплатить и пройти «Марафон дружбы» за 15 тысяч рублей.

@superru

Тимати высказался о конфликте между Россией и Украиной. Рэпер считает, что война никому не нужна.

«Мне очень, очень жаль, что мы пришли в эту точку, казалось бы, невозврата. Нужен диалог. И мир двух очень близких по своей ментальности стран. Также никому не нужна сильная Россия. Им нужен еще один Горбачев или Ельцин. Но у истории другие планы», — пишет артист на своей странице в Инстаграме.

@superru

На днях американский таблоид сообщил о смерти Елизаветы II. Внезапный некролог потряс и возмутил британцев, назвавших это вбросом. Известно, что у Букингемского дворца существует целый полномасштабный план действий на случай смерти монарха и «сливы» прессе в нем точно не предусмотрены.

О настоящих планах правительства после смерти Елизаветы II читайте на нашем сайте.

@superru

Валерий Меладзе, как и многие знаменитости, не смог пройти мимо новостей из Донбасса.

Певец записал видеообращение, в котором умоляет прекратить военные действия и начать переговоры. «Люди не должны погибать. Это нужно прекратить», — говорит артист.

@superru

Владимир Путин объявил, что принял решение о специальной военной операции в Донбассе. Президент сообщил, что в планы России входит демилитаризация Украины. Как отметил Путин, столкновения с силами Украины неизбежны.

«Это только вопрос времени. Они готовятся, они ждут удобного часа. Теперь претендуют еще и на обладание ядерным оружием. Мы не позволим им этого сделать».

@superru

Журнал Maxim к 8 марта представил новую обложку с лучшими мужчинами страны по их версии — психологом Михаилом Лабковским, актером Сергеем Буруновым и певцом Niletto. В пабликах уже начали дискуссию о токсичной маскулинности, сравнивая троицу с западными героями обложек. В последнее время на страницах глянца можно было увидеть нового Бэтмена Роберта Паттинсона, сына Дэвида Бекхэма, Бенедикта Камбербэтча, восходящих звезд Евровидения Mahmood & Blanco или, например, сына Арнольда Шварценеггера Джозефа Баэну. 

Пользуясь случаем, поздравляем всех мужчин с первым гендерным праздником в этом году — с 23 Февраля!

@superru

И еще постеры вдогонку: Мадс Миккельсен, сменивший Джонни Деппа, в роли Грин-де-Вальда, и российский актер Александр Кузнецов, исполнивший роль Хельмута Вайса — нового, и, надеемся, значимого для сюжета героя.

Свои постеры получили Криденс и Куинни, ставшие на сторону тьмы, а также много новых персонажей, представителей магического сообщества со всего мира, которым предстоит выбрать сторону в противостоянии Дамблдора и Грин-де-Вальда.

@superru

Появились первые персональные постеры с героями третьей части «Фантастических тварей», получившей название «Тайны Дамблдора». На фото можно заметить как знакомых героев, среди которых Альбус, Ньют, Якоб и Тесеус, так и новых персонажей из «первого отряда Дамблдора». 

Поклонники франшизы сразу заметили, что на постерах нет Тины и Куини, полюбившихся героинь из предыдущих частей серии. Возможно, кого-то из них мы скоро увидим в команде злодеев — премьера фильма назначена на 7 апреля этого года. 

@superru

Пока жертвы «афериста из Тиндера» собирают пожертвования, чтобы расплатиться по долгам, и требуют по закону наказать обидчика, Саймон продолжает кутить.

Его заметили в Тель-Авиве, где одетый в Gucci Леваев выбирал в автосалоне машину, облюбовав Ferrari 296GTB стоимостью 360 900 долларов. Рядом с Саймоном был новый секьюрити, а не телохранитель Петр, который также засветился в документалке. Сейчас Петр собирается судиться с Netflix — он требует удалить из общего доступа фильм и выплатить ему 5 млн евро за испорченную репутацию.

@superru

Наши олимпийцы наконец-то в Москве. Сразу после прилёта они встретились с болельщиками и близкими, а после отправились на ВТБ-Арену, где для них устроили праздник. 

Флаг России под гимн подняли Анна Щербакова и Александр Большунов — спортсмены, которые выиграли золотые медали в личных турнирах. 

@superru

Сегодня Эллиот Пейдж отмечает 35-й день рождения. Идет второй год, как звезда фильмов «Начало» и «Джуно» живет в новом теле после гормонотерапии и операции по смене пола.

На днях он заключил контракт с изданием Flatiron Books, которое выпустит книгу об актере под названием Pageboy («Слуга»). За автобиографию Эллиот получит гонорар 3 млн долларов. В мемуарах он хочет рассказать о своей жизни после каминг-аута, а также о сексуальных домогательствах со стороны известного режиссера и ссоре со «звездой первого эшелона» из-за его отношения к квир-сообществу.

@superru

Больная коронавирусом Елизавета II в понедельник вернулась к обязанностям в Виндзорском замке. За 95-летней королевой постоянно присматривают медики, пока что монарх ограничивается работой с документами.

В это время где-то грустит один Джастин Бибер, которому пришлось отменить шоу в Лас-Вегасе из-за положительного теста на ковид.

@superru

«Аферист из Tinder» Саймон Леваев перестал обманывать женщин и наконец-то стал зарабатывать сам — на видеооткрытках. Предприимчивый мошенник зарегистрировался на специальном сайте и теперь продает за 200 долларов поздравления с днем рождения и годовщиной, а также рекламу для бизнеса за 2к. Как пишут TMZ, Леваев уже заработал на поздравляшках 30 тысяч за три дня.

Саймон долго пытался оправдаться в соцсетях и заявлял, что он никого не обманывал, но пиар в Netflix сделал свое дело. Теперь бодрый блогер шутит в своих видео, что враги преследуют его, и это приводит фанатов в восторг.

@superru
